import React, { useState } from 'react';
import './PropertyDetail.css';

const PropertyDetail = ({ property, onClose }) => {
    const [currentImageIndex, setCurrentImageIndex] = useState(0);

    // Dummy images - akan diganti dengan data real
    const propertyImages = [
        property.image,
        property.image,
        property.image
    ];

    const nextImage = () => {
        setCurrentImageIndex((prev) => 
            prev === propertyImages.length - 1 ? 0 : prev + 1
        );
    };

    const prevImage = () => {
        setCurrentImageIndex((prev) => 
            prev === 0 ? propertyImages.length - 1 : prev - 1
        );
    };

    const goToImage = (index) => {
        setCurrentImageIndex(index);
    };

    return (
        <div className="modal-overlay" onClick={onClose}>
            <div className="modal-content" onClick={(e) => e.stopPropagation()}>
                <button className="modal-close" onClick={onClose}>
                    √ó
                </button>
                
                <div className="modal-body">
                    {/* Image Slider */}
                    <div className="property-slider">
                        <div className="slider-main">
                            <button className="slider-btn prev" onClick={prevImage}>
                                ‚Äπ
                            </button>
                            <img 
                                src={propertyImages[currentImageIndex]} 
                                alt={property.title}
                                className="slider-image"
                            />
                            <button className="slider-btn next" onClick={nextImage}>
                                ‚Ä∫
                            </button>
                        </div>
                        
                        {/* Thumbnail Navigation */}
                        <div className="slider-thumbnails">
                            {propertyImages.map((img, index) => (
                                <div
                                    key={index}
                                    className={`thumbnail ${index === currentImageIndex ? 'active' : ''}`}
                                    onClick={() => goToImage(index)}
                                >
                                    <img src={img} alt={`Thumbnail ${index + 1}`} />
                                </div>
                            ))}
                        </div>
                    </div>

                    {/* Property Info */}
                    <div className="property-detail-info">
                        <h2>{property.title}</h2>
                        <p className="detail-location">
                            <span className="location-icon">üìç</span>
                            {property.location}
                        </p>

                        {/* Property Description */}
                        <div className="detail-section">
                            <h3>Deskripsi</h3>
                            <p>
                                Lorem ipsum dolor sit amet, consectetur adipiscing elit. 
                                Properti dengan lokasi strategis dan fasilitas lengkap.
                            </p>
                        </div>

                        {/* Property Specifications */}
                        <div className="detail-section">
                            <h3>Spesifikasi</h3>
                            <div className="specs-grid">
                                <div className="spec-item">
                                    <span className="spec-icon">üè†</span>
                                    <div>
                                        <p className="spec-label">Luas Tanah</p>
                                        <p className="spec-value">120 m¬≤</p>
                                    </div>
                                </div>
                                <div className="spec-item">
                                    <span className="spec-icon">üè¢</span>
                                    <div>
                                        <p className="spec-label">Luas Bangunan</p>
                                        <p className="spec-value">80 m¬≤</p>
                                    </div>
                                </div>
                                <div className="spec-item">
                                    <span className="spec-icon">üõèÔ∏è</span>
                                    <div>
                                        <p className="spec-label">Kamar Tidur</p>
                                        <p className="spec-value">3</p>
                                    </div>
                                </div>
                                <div className="spec-item">
                                    <span className="spec-icon">üöø</span>
                                    <div>
                                        <p className="spec-label">Kamar Mandi</p>
                                        <p className="spec-value">2</p>
                                    </div>
                                </div>
                            </div>
                        </div>

                        {/* Facilities */}
                        <div className="detail-section">
                            <h3>Fasilitas</h3>
                            <ul className="facilities-list">
                                <li>‚úì Carport</li>
                                <li>‚úì Taman</li>
                                <li>‚úì Listrik 2200 Watt</li>
                                <li>‚úì Air PAM</li>
                            </ul>
                        </div>

                        {/* Price and Contact */}
                        <div className="detail-section price-section">
                            <div className="price-info">
                                <p className="price-label">Harga Mulai</p>
                                <p className="price-value">Rp 500.000.000</p>
                            </div>
                            <button className="contact-btn">
                                Hubungi Kami
                            </button>
                        </div>
                    </div>
                </div>
            </div>
        </div>
    );
};

export default PropertyDetail;
